description:
Verenigde Staten
Actie / Fantasy
92 minuten

goeie film

met Will Smith, Charlize Theron en Jason Bateman

Grote macht brengt grote verantwoordelijkheid met zich mee en dat weet iedereen. Iedereen behalve Hancock. Hij is een nerveuze, sarcastische en onbegrepen kerel vol tegenstrijdigheden en zijn goed bedoeld heldhaftig gedrag bereikt misschien wel zijn doel en redt talloze levens, maar laat ook een indrukwekkend spoor van vernieling na. Het publiek heeft er uiteindelijk de buik van vol, tot op de dag dat hij het leven redt van PR directeur Ray Embrey (Jason Bateman). Dan begint de sardonische superheld te beseffen dat hij misschien toch ook een kwetsbare kant heeft. Dat onder ogen zien zou wel eens Hancocks grootste uitdaging ooit kunnen worden.:
